import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import { AppBar, ThemeProvider } from '@material-ui/core';
 //import "/Components/EmpDetailsCard/card.css"
 import InputLabel from '@material-ui/core/InputLabel';
import FormHelperText from '@material-ui/core/FormHelperText';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import NativeSelect from '@material-ui/core/NativeSelect';

const useStyles = makeStyles({
  root: {

    fontSize: 20,
    width: 800,
    height:700,
    marginTop:110,
    marginLeft:100,
    marginRight:420,
    marginBottom: 400,
    textAlign:'justify',



  },
  title: {
    fontSize: 32,
    marginLeft:60,
    font:'Bold'

  },

  input: {
    fontSize: 20,
    borderleftwidth: 10,
    marginLeft:960,
    borderLeftwidth: 80


  },

  name: {
    fontSize: 15,
    marginTop:30,
    marginLeft:60,
    marginRight:420,

  },

  formControl: {

    minWidth: 120,
  },

});

export const MuiCard = () => { 
  const classes = useStyles();


  return (


    <Card className={classes.root}>

        <Typography className={classes.title} >
          Employee Payroll Form 

        </Typography>
        <Typography className={classes.name} > Name       
        <input classname = {classes.input} type="text" id="message" name="message"/>
        <div>Profile image
        <input type="radio"  name="gender" /> 
        <input type="radio"  name="gender" /> 
        <input type="radio"  name="gender" /> 
        <input type="radio"  name="gender" /> 

      </div>
        <div>Gender
        <input type="radio" value="Male" name="gender" /> Male
        <input type="radio" value="Female" name="gender" /> Female

      </div>
      <div>Salary
      <FormControl className={classes.formControl}>
        <InputLabel className={classes.name} htmlFor="uncontrolled-native" placeholder='Select Salary'></InputLabel>
        <NativeSelect></NativeSelect>

      </FormControl>

         </div>
        </Typography>



    </Card>



  );
}
